import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import Nav from "./Nav";
import Home from "./Home";

import Footer from "./Footer";
import "../styles/main.scss";

const App = () => {
  return (
    <Router>
      <div>
        <Nav></Nav>
        <Route path="/" component={Home}></Route>

        <Footer></Footer>
      </div>
    </Router>
  );
};

export default App;
